        const handlePlayClick = (event) => {
            var coin = document.getElementById("coin");
            var result = document.getElementById("result");
            result.innerHTML = "Flip in progress!";
            event.target.onclick = (event) => { };
            coin.src = coin_flip_base64;
            setTimeout(() => {
                if (Math.random() >= 0.5) {
                    coin.src = tails_base64;
                    result.innerHTML = "Tails !"
                }
                else {
                    coin.src = head_base64;
                    result.innerHTML = "Head !"
                }
                event.target.onclick = handlePlayClick;
            }, 3850);
        };
